.nav-bar-container {
  background-color: rgba(255, 255, 255, 1);
  display: flex;
  padding: 0 20px;
  justify-content: space-between;
  position: fixed;
  top: 0;
  width: 100%;
  height: 8vh;
  text-transform: capitalize;
