.nav-bar {
  display: flex;
  background-color: rgba(255, 255, 255, 1);
  position: absolute;
  text-align: left;
  top: 100%;
  left: 0;
  right: 0;
  transform: scale(1, 0);
  transform-origin: top;
  transition: transform 400ms ease-in-out;
  border-bottom: 0.5px solid rgba(41, 51, 71, 0.5);
}

nav ul {
  display: flex;
  flex-direction: column;
  height: 18vh;
  width: 100%;
}

.nav-link {
  font-weight: 500;
}

