  opacity: 0;
  transition: opacity 150ms ease-in-out;
  display: flex;
  height: 6vh;
}

nav ul li {
  padding: 0 20px;
}

.nav-toggle:checked ~ .nav-bar {
  transform: scale(1, 1);
}

.nav-toggle:checked ~ nav a {
  opacity: 1;
  transition: opacity 250ms ease-in-out 50ms;
}

.nav-toggle {
  position: absolute !important;
  display: none;
}

.nav-toggle-label {
  height: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
}

