    display: flex;
    justify-content: flex-end;
    align-items: center;
    border-bottom: unset;
  }

  nav ul {
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: flex-start;
    height: 100%;
  }

  nav ul li {
    padding-bottom: 0;
    padding-left: 1em;
  }

  .nav-link {
    display: flex;
    align-items: center;
    opacity: 1;
    transform: scale(1, 1);
    transition: transform ease-in-out 250ms;
    height: initial;
  }

  .nav-link::before {
    content: '';
    display: block;
    height: 4px;
    @include themify {
      background-color: $color-linkTextHover;
    }
    border-radius: 3px;
    position: absolute;
    top: -0.75em;
    left: 0;
    right: 0;
    transform: scale(0, 1);
    transition: transform ease-in-out 250ms;
  }

  .nav-link:hover::before {
    transform: scale(1, 1);
  }

  .header-img {
    width: 25vw;
    height: 25vw;
    /* margin-top: 40px; */
  }

  .header-content {
    grid-column: 2 / span 1;
    width: 80%;
    justify-self: center;
    font-size: large;
  }

  .header-content p {
    font-size: x-large;
  }

  .skill {
    width: 33.33%;
  }
}
/* Responsive design ends here  */
